let disp_ref=document.getElementById("disp")
let d1_ref=document.getElementById("start")
let d2_ref=document.getElementById("end")
let disp=(d1,d2)=>{
    disp_ref.innerHTML=""
    let c=1
    for(let i=0;i<data.length;i++){
        let d=new Date(data[i].date)
        console.log(d)
        if(d.getTime()>=d1.getTime() && d.getTime()<=d2.getTime())
        { 
            disp_ref.innerHTML+=`<div class="card">
            <div class="x">${c} (<i class="fa-solid fa-caret-up" style="color: #14c841;"></i> 10)</div> 
            <div class="abc">
                <div class="sign1"><i class="fa-regular fa-bookmark"></i></div>
                <div class="sign2"><i class="fa-solid fa-plus"></i></i></div></div>
            <div class="poster">
                
                <img src="${data[i].image}"/>
            </div>
            <div class="cont">
            <div class="rating">
            <i class="fa-solid fa-star gold"></i> <p class="rv"> ${data[i].rating} </p><i class="fa-regular fa-star blue"></i> <p class="rt">Rate</p>
            </div> 
            <div class="title">${data[i].name}</div>
            <div class="msg">${data[i].message}</div>
            <div class="dt">${data[i].date}</div></div> </div>

            
            </div>`
        c++
            
        }
    }
}

let show=()=>{
    var d1=new Date(d1_ref.value)
    var d2=new Date(d2_ref.value)
    if(d1_ref.value!="" && d2_ref.value!=""){
        disp(d1,d2)}
        
    }
let a=new Date("01-01-1900")
let b=new Date("01-01-2025")
disp(a,b)
    


